    [],nt"revision_timestamp": "2015-07-23T18:25:24.450244",nt"name": "presidents-fiscal-year-2016-budget-data",nt"isopen":
    false,nt"url": null,nt"notes": "Each year, after the President's State
    of the Union address, the Office of Management and Budget releases the Administration's
    Budget, offering proposals on key priorities and newly announced initiatives. This
    year we are releasing all of the data included in the President's Fiscal Year 2016
    Budget in a machine-readable format on GitHub. The Budget process should be a reflection
    of our values as a country, and we think it's important that members of the public
    have as many tools at their disposal as possible to see what is in the President's
    proposals. And, if they're motivated to create their own visualizations or products
    from the data, they should have that chance as well.",nt"license_title": "License
